import { useState} from "react";

function Profile() {
    return (
        <div className="main-div">
            <div className="change-password-div">
                <div>
                    Change your password:
                </div>
                <div>New password: <input type="password"></input></div>
                <div>Confirm password: <input type="password"></input></div>
            </div>
        </div>
    );
}

export default Profile;
